import * as React from 'react';
import { View, Text, Button, StyleSheet, Image, ScrollView, Dimensions, ImageBackground, Switch, TextInput } from 'react-native';
import { useEffect, useState, useReducer } from 'react'
import { TouchableOpacity } from 'react-native-gesture-handler';

const windowWidth = Dimensions.get('window').width;
const windowHeight = Dimensions.get('window').height;

const styles = StyleSheet.create({
    container: 
    {
        backgroundColor: 'rgb(21, 34, 56)',
        height: windowHeight,
        width: windowWidth,
        alignItems: 'center'
    },
    textInput: 
    {
        height: 50, //to be determined,
        width: windowWidth - 30,
        backgroundColor: 'rgb(35, 57, 109)',
        borderRadius: 10,
        padding: '3%',
        color: 'white',
        fontSize: 15
    },
    button:
    {
        color: 'white',
        width: (windowWidth - 30) / 2,
        height: 40,
        marginTop: 40,
        backgroundColor: 'rgb(32, 51, 84)',
        borderRadius: 10,
        alignItems: 'center',

    }
})

function EditPrinterNameView()
{
    const [value, onChangeText] = useState('Printer Name');

    return(
        <View style={ styles.container }>
            <TextInput
                style={ styles.textInput }
                onChangeText={text => onChangeText(text)}
                value={value}
            />
            <TouchableOpacity style={styles.button}>
                <Text style={{ color: 'white', marginTop: 20 }}>Update Name</Text>
            </TouchableOpacity>
        </View>
    )
}

export { EditPrinterNameView };
